import './App.css';
import Lists from './Components/Lists';

function Header(props) {
    return (
      <div>
        <h1>Full Stack Development Roadmap- {props.year}</h1>
      </div>
    )
}


function Footer(props) {
  return (
    <div>
      <p>Made with Love by- {props.author}</p>
    </div>
  )
}


function App() {
  return (
    <div className="App">
      <Header year="2022" />
      <Footer author="Tarun Singh"/>
    </div>
  );
}

export default App;
